import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Strategy() {
  return (
    <Container fluid>
      <div style={{ textAlign: "center" }}>
        <h1 style={{ fontFamily: "primary-font", fontSize: 55 }}>
          Our strategy
        </h1>
      </div>

      <Row
        className="g-1 mt-5"
        style={{
          display: "flex",
          justifyContent: "center",
          marginLeft: 0,
          marginRight: 0,
        }}
      >
        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
        </Col>
      </Row>
    </Container>
  );
}

export default Strategy;
